import { Component } from 'react';



class Page3 extends Component {
   
    render() {
        return (
            <div className="sheet">
                <h1 className="bold center">Plan for the day</h1>
                <div className='left container_for_medium_margin'>
                    <ol>
                        <li>Icebreaker game</li>
                        <li>Check in about your coping strategies</li> 
                        <li>Watch a video about getting support</li>
                        <li>Brainstorm the people you can go to for support</li>
                        <li>Pick a 3<sup>rd</sup> coping strategy</li>
                        <li>Time for questions</li>
                        <li>Reminders about mentoring</li>
                        <li>Make a plan for practice</li>
                    </ol>
                </div>
            </div>
        )
    }
}
export default Page3;
